double Dynamics::_DifferentiationOperator(double currentValue, double previousValue, double& looptime){
	return (currentValue - previousValue) / (1/looptime);
}

double Dynamics::_IntegrationOperator(double currentValue, double inputIntegrationVal, double& looptime){
	inputIntegrationVal += currentValue * (1/looptime);
	return inputIntegrationVal;
}